"use strict";angular.module("app").factory("masterPage",function(b,a){return{pagesClick:function(c,d){d.params.page=c.x;a.go("master",d.params);console.log(d.params)},pageKed:function(f,d){var c=window.event?f.keyCode:f.which;if(c==13){d.params.page=1;a.go("master",d.params)}},pagesClickS:function(c){c.params.page=1;a.go("master",c.params)},pagesClickSy:function(c){if(c.params.page>1){c.params.page=c.params.page-1;a.go("master",c.params)}else{bootbox.alert("当前页为首页")}},pagesClickXy:function(c){if(c.params.page<c.pages){c.params.page=parseInt(c.params.page)+1;a.go("master",c.params)}else{bootbox.alert("当前页为末页")}},pagesClickM:function(c){c.params.page=c.pages;a.go("master",c.params)},pagesNumClick:function(c){if(c.pagesNum<=c.pages&&c.pagesNum>0){c.params.page=parseInt(c.pagesNum);a.go("master",c.params)}else{bootbox.alert({message:"请输入正确的页数",size:"small"})}},pageArr:function(c){if(c.pages>5){c.params.page=parseInt(c.params.page);if(c.params.page>=3&&c.params.page<=c.pages-3){c.pageCycle=[c.params.page-2,c.params.page-1,c.params.page,c.params.page+1,c.params.page+2]}else{if(c.params.page<3){c.pageCycle=[];for(var i=1;i<=5;i++){c.pageCycle.push(i)}}else{if(c.params.page>c.pages-3){c.pageCycle=[];var d=c.pages-4;for(var h=d;h<=c.pages;h++){c.pageCycle.push(h)}}}}}else{c.pageCycle=[];for(var j=1;j<=c.pages;j++){c.pageCycle.push(j)}}}}});